import React, { useState } from "react";
import Input from "./inputs/Input";

function ContactForm() {
  return (
    <div>
      <div className="form-group">
        <Input labelText={"Nume"} inputName={"nume"} inputType={"text"} />
      </div>
    </div>
  );
}

export default ContactForm;
